F2 = lambda x_1, x_2, x_3: -b*x_1 + g*x_2
F3 = lambda x_1, x_2, x_3: a*x_1 + g*x_2

def system(x, t, a, b, g):
    x_1, x_2, x_3 = x
    dxdt = [F1(x_1, x_2, x_3) + u1(t),
            F2(x_1, x_2, x_3) + u2(t),
            F3(x_1, x_2, x_3)]
    return dxdt


